import React, { Component } from 'react';
import './App.css';
import { AppFrame } from './Components';
import { Dashboard, Recordings, GPSMap} from './Pages';


class App extends Component {

  state = {
    page : <Dashboard/>
  }

  componentDidMount() {
    document.getElementById('nav_dashboard').onClick = () => this.setState({page : <Dashboard/>});
    document.getElementById('nav_recordings').onClick = () => this.setState({page : <Recordings/>});
    document.getElementById('nav_gpsmap').onClick = () => this.setState({page : <GPSMap/>});
  }

  render() {
    return (
      <div className="App">
        <AppFrame/>
        {this.state.page}
      </div>
    );

  }
}

export default App;
